$(function(){$("#searchForm").on("submit",function(a){a.preventDefault();var b=$("#mainSearchInputField");$.ajax({url:"/search",method:"POST",contentType:"application/json",data:JSON.stringify({restaurantQuery:b.val()}),success:function(a){$(".hero-browser-inner").empty().append(JSON.stringify(a).replace(/\"/g,"")),b.val("")}})})});